import React from 'react'
import { Link } from 'react-router-dom'

const Navbar = () => {
    return (
        <nav className="nav-wrapper grey darken-3">
            
                <Link to='/' className="brand-logo">MarioPlan</Link>
            
        </nav>
    
    )
}

export default Navbar;
